import Footer from "./Footer";
import Navbar from "./Navbar";
import './Layout.css';

export default function Layout({ children }) {
    return (
        <>

            <div className="layout">
                <Navbar />
                <main className="layout-main">
                </main>
                <main style={{ maxhei: fitcontent }}>{children}</main>
                <Footer />
            </div>
        </>
    )
}
